const b64 = s => new Uint8Array(atob(s).split("").map(c => c.charCodeAt(0)));
function getMime(p){const e=p.split('.').pop().toLowerCase();const m={'html':'text/html','css':'text/css','js':'application/javascript','png':'image/png','jpg':'image/jpeg','jpeg':'image/jpeg','gif':'image/gif','svg':'image/svg+xml'};return m[e]||'application/octet-stream';}
async function un(b, p, s){const r=b64(b),bs=await crypto.subtle.importKey("raw",new TextEncoder().encode(p),"PBKDF2",false,["deriveKey"]);const k=await crypto.subtle.deriveKey({name:"PBKDF2",salt:b64(s),iterations:500000,hash:"SHA-256"},bs,{name:"AES-GCM",length:256},false,["decrypt"]);return new Uint8Array(await crypto.subtle.decrypt({name:"AES-GCM",iv:r.slice(0,12)},k,r.slice(12)));}

document.getElementById("unl").onclick = async () => {
    const p = document.getElementById("pw").value, m = document.getElementById("m");
    if(!p) return; m.innerText = "Ê≠£Âú®ÈáçÂª∫Ë∑ØÂæëÊò†Â∞Ñ...";
    try {
        let dek; try { dek = await un(_UK, p, _S); } catch(e) { dek = await un(_AK, p, _S); }
        const k = await crypto.subtle.importKey("raw", dek, "AES-GCM", false, ["decrypt"]);
        const dec = await crypto.subtle.decrypt({ name: "AES-GCM", iv: b64(_I) }, k, b64(_D));
        const zip = await JSZip.loadAsync(dec);
        const files = {};
        const sortedPaths = Object.keys(zip.files).sort((a, b) => b.length - a.length);

        for (let path of sortedPaths) {
            if (!zip.files[path].dir) {
                const content = await zip.files[path].async("blob");
                files[path] = URL.createObjectURL(new Blob([content], { type: getMime(path) }));
            }
        }

        for (let path of sortedPaths) {
            if (path.endsWith('.html') || path.endsWith('.css')) {
                let text = await zip.files[path].async("text");
                for (let opath in files) {
                    if (opath === path) continue;
                    const escaped = opath.replace(/[.*+?^$${}()|[]\\]/g, '\\$&');
                    text = text.replace(new RegExp(escaped, 'g'), files[opath]);
                    const encoded = encodeURIComponent(opath).replace(/[.*+?^$${}()|[]\\]/g, '\\$&');
                    text = text.replace(new RegExp(encoded, 'g'), files[opath]);
                }
                files[path] = URL.createObjectURL(new Blob([text], { type: getMime(path) }));
            }
        }
        const entry = files["index.html"] || files[Object.keys(files)[0]];
        document.getElementById("box").style.display = "none";
        const f = document.getElementById("v-frame"); f.style.display = "block"; f.src = entry;
    } catch(e) { m.innerText = "‚ùå ÂØÜÈë∞ÈåØË™§ÊàñËß£ÂØÜÂ§±Êïó"; }
};
